import * as React from 'react';
import './video.scss';

type VideoProps = {
  videoId: string;
};
const Video: React.FC<VideoProps> = ({ videoId }) => {
  return (
    <div className="w-[560px] h-[315px] relative">
      <iframe
        width="560"
        height="315"
        // src="https://www.youtube.com/embed/ADY-pe810Bk"
        src={`
            https://www.youtube.com/embed/${videoId}?rel=1&showinfo=1&autoplay=0
            `}
        title="YouTube video player"
        frameBorder="0"
        allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
        allowFullScreen
      ></iframe>
      <div className="absolute top-0 cursor-pointer">
        <span className="player hover:bg-red-600 absolute w-16 h-11  rounded-md top-1/2 left-1/2 -translate-x-1/2 -translate-y-1/2  bg-[#8e8e8e79]">
          <span className="absolute triangle top-1/2 left-1/2 -translate-x-1/4 -translate-y-1/2   "></span>
        </span>
        <img
          className="w-[560px] h-[315px] object-cover object-center"
          src={`https://img.youtube.com/vi/${videoId}/hqdefault.jpg`}
          alt=""
        />
      </div>
    </div>
  );
};

export { Video };
